To make the search functionality work properly, we need to fix several issues in your HTML and JavaScript code:

1. The jQuery library is not being loaded properly. It seems there's a protocol-relative URL (`//code.jquery.com/jquery-1.11.3.min.js`). To ensure it works in all scenarios, let's replace it with an HTTPS URL to load jQuery.

2. There's a mismatch in the `id` attributes of the input elements. The input field and the div element both have the same `id` attribute (`search_text`). We need to change the `id` of the div element to avoid conflicts.

3. The `findString` function should accept the `search_str` parameter instead of using a global variable.

Here's the corrected code:

```html
<!DOCTYPE html>
<html lang="en">

