<body>
    <div class="container-fluid fluidBlue glossaryTop">
        <div class="container obamacare101">
            <h1>RESOURCE CENTER: FAQs</h1>
            <h2 class="hidden-xs">Have a question? Enter a search term or <br />choose from the list below. </h2>
            <h2 class="visible-xs">Have a question? <br />Enter a search term or <br />choose from the list below. </h2>
            <div>&nbsp;&nbsp;&nbsp;&nbsp;
                <input type="text" placeholder="Enter term or phrase" id="search_input">&nbsp;&nbsp;&nbsp;&nbsp;
                <input type="submit" value="Search" id="search_submit"> &nbsp;&nbsp;&nbsp;&nbsp;
