        generally doin the same thing and giving importance to the prompt same thing goes for question marks although
        this was just a myth back in the day. Although I will say doing so adds spice or a random seasoning to a dish.
        As for :: it's a replacement for commas for more prompt room, it works as a divider of prompts the same way
        commas w ould but without using the character count so it was really useful for single prompts. However nowadays
        instead of using quotations I use "(red eyes:1.2)" since various other generators recognize this method more
        often than not. Note that the numbers stand for the prompt weight and the parentheses seperate the subjects so
        whatever was inside would be what the 1.2 would effect you can use various weights but anything from 0.5 to 1.2
        or 1.3 is best above that and it'll get overcooked and lose its meaning
    </div>

    <script>
        jQuery("#search_submit").on("click", function () {
            var search_str = jQuery("#search_input").val();
            findString(search_str);
            return false;
        });

        var TRange = null;

        function findString(str) {
            if (parseInt(navigator.appVersion) < 4) return;
            var strFound;
            if (window.find) {

                // CODE FOR BROWSERS THAT SUPPORT window.find

                var original_content = window;
                strFound = original_content.find(str);
                if (!strFound) {
                    strFound = original_content.find(str, 0, 1);
                    while (original_content.find(str, 0, 1)) continue;
                }
            } else if (navigator.appName.indexOf("Microsoft") != -1) {

                // EXPLORER-SPECIFIC CODE

                if (TRange != null) {
                    TRange.collapse(false);
                    strFound = TRange.findText(str);
                    if (strFound) TRange.select();
